import React from 'react';

import AddUser from './Users/AddUser';
import UsersList from './Users/UsersList';

function App() {

    const dummyUsers = [
        {
            id: Math.random(),
            name: "Michael",
            age: 21,
        }
    ];

    return (
    <div>
            <AddUser />
            <UsersList users={dummyUsers} />
    </div>
    );
}

export default App;
